import math
def nthpowerfulnumber(n):
    found=0
    guess=0
    while(found<=n):
        guess+=1
        if(power(guess)):
            found+=1
    return guess
 
def power(x):
    while(x%2==0):
        count=0
        while(x%2==0):
            x//=2
            count+=1
        if(count==1):
            return False
 
    for i in range(3,int(math.sqrt(x))+1,2):
        count=0
        while(x%i==0):
            x//=i
            count+=1
        if(count==1):
            return False
    return x==1
